import React from 'react';
import LogoSidebar from './logo/LogoSidebar';
import ToggeMenu from './contenue_sidebar/ToggeMenu';
import Menu from './contenue_sidebar/Menu';

const Sidebar = () => {
    const dataTable = [
        { to: '/membres', text: 'Table 1' },
        { to: '/tables/some-table', text: 'Table 2' }
    ];

    const membreData = [
        { to: '/membre/some-member', text: 'Some Member' }

    ];


    return (
        <>
            <aside className="main-sidebar sidebar-dark-primary elevation-4">

                <LogoSidebar />
                <br />
                {/* Sidebar Menu */}
                <div className="sidebar">
                    <ul className="nav nav-pills nav-sidebar flex-column" data-widget="treeview" role="menu" data-accordion="false">
                        <ToggeMenu menuTitle="Tables" menuIcon="fas fa-table" subItems={dataTable} />
                        <Menu menuTitle={"Marque voiture"} menuIcon={"fas fa-table"} to={"/marque"} />
                        <ToggeMenu menuTitle="Membre" menuIcon="fas fa-user" subItems={membreData} />
                    </ul>
                </div>
                {/* /.sidebar-menu */}
            </aside>
        </>
    );
};

export default Sidebar;
